import React from "react";
import { Link } from "react-router-dom";
import { motion } from "framer-motion";
import "../styles/styles.css";

const Home = () => {
  return (
    <motion.div
      className="home-container"
      initial={{ opacity: 0 }}
      animate={{ opacity: 1 }}
      transition={{ duration: 0.8 }}
      style={{
        background: "linear-gradient(to right, #e0f7fa, #f5faff)",
        minHeight: "100vh",
        padding: "3rem",
      }}
    >
      <motion.h1 className="home-title" initial={{ y: -30, opacity: 0 }} animate={{ y: 0, opacity: 1 }} transition={{ delay: 0.2 }}>
        üåç Welcome to Kubernetes Issue Predictor
      </motion.h1>

      <motion.p className="home-description" initial={{ y: -20, opacity: 0 }} animate={{ y: 0, opacity: 1 }} transition={{ delay: 0.3 }}>
        Stay ahead of issues in your Kubernetes cluster with real-time monitoring and AI-powered predictive analysis.
      </motion.p>

      <motion.div className="home-buttons" initial={{ scale: 0.8, opacity: 0 }} animate={{ scale: 1, opacity: 1 }} transition={{ delay: 0.5 }}>
        <Link to="/dashboard"><motion.button whileHover={{ scale: 1.05 }} className="btn primary">üìä Go to Dashboard</motion.button></Link>
        <Link to="/issues"><motion.button whileHover={{ scale: 1.05 }} className="btn secondary">‚ö†Ô∏è View Issues</motion.button></Link>
      </motion.div>

      {/* üöÄ Feature Highlights */}
      <div className="features">
        {[
          { icon: "üîç", title: "Real-Time Monitoring", description: "Track cluster health and detect issues instantly." },
          { icon: "üß†", title: "Predictive Analysis", description: "AI-powered insights to forecast potential failures." },
          { icon: "üìà", title: "Performance Reports", description: "Detailed analytics for better decision-making." }
        ].map((feature, index) => (
          <motion.div
            className="feature-card"
            key={index}
            whileHover={{ scale: 1.05 }}
            initial={{ opacity: 0, y: 20 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ delay: 0.6 + index * 0.2 }}
          >
            <h3>{feature.icon} {feature.title}</h3>
            <p>{feature.description}</p>
          </motion.div>
        ))}
      </div>

      {/* üí° Why Choose Us */}
      <motion.div className="why-us" initial={{ opacity: 0 }} animate={{ opacity: 1 }} transition={{ delay: 1 }}>
        <h2>üí° Why Choose Us?</h2>
        <ul>
          <li>‚úÖ Instant alerts on critical issues</li>
          <li>‚úÖ Accurate predictions powered by AI</li>
          <li>‚úÖ User-friendly dashboard and reports</li>
          <li>‚úÖ Continuous updates and improvements</li>
        </ul>
      </motion.div>

      {/* üí¨ Testimonials */}
      <motion.div className="testimonials" initial={{ opacity: 0 }} animate={{ opacity: 1 }} transition={{ delay: 1.2 }}>
        <h2>üí¨ What Users Say</h2>
        <div className="testimonial-cards">
          <div className="testimonial">
            <p>‚ÄúThis tool saved us from multiple outages. The predictions are scary accurate!‚Äù</p>
            <span>- DevOps Engineer, CloudCorp</span>
          </div>
          <div className="testimonial">
            <p>‚ÄúThe UI is simple and effective. Our team loves using it daily.‚Äù</p>
            <span>- SRE Lead, KubeServe</span>
          </div>
        </div>
      </motion.div>

      {/* üöÄ Getting Started */}
      <motion.div className="getting-started" initial={{ opacity: 0 }} animate={{ opacity: 1 }} transition={{ delay: 1.4 }}>
        <h2>üöÄ Ready to Get Started?</h2>
        <p>Connect your Kubernetes cluster and start tracking within minutes.</p>
        <Link to="/dashboard">
          <motion.button whileHover={{ scale: 1.1 }} className="btn primary">üîó Connect Now</motion.button>
        </Link>
      </motion.div>
    </motion.div>
  );
};

export default Home;
